Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
	if (_parent.方向 == "右")
	{
		_parent.移动("右",慢速度);
	}
	else if (_parent.方向 == "左")
	{
		_parent.移动("左",慢速度);
	}
}

//硬代码跳一下帧
function 向前跳帧(帧数)
{
	if (帧数 <= 0)
	{
		帧数 = 1;
	}
	gotoAndPlay(this._currentframe + 帧数);
}

gotoAndPlay(_parent.近战招式);

if(_parent.行走X速度 < _parent.基本速度 * 2)
{
   _parent.行走X速度 += 1;
   _parent.行走Y速度 = _parent.行走X速度 / 2;
   _parent.跑X速度 = _parent.行走X速度 * 2;
   _parent.跑Y速度 = _parent.行走X速度;
}
if(_parent.被击硬直度 > _parent.基本被击硬直度 / 5)
{
   _parent.被击硬直度 -= 8;
}
if(_parent.空手攻击力 < _parent.基本空手攻击力 * 5)
{
   _parent.空手攻击力 += _parent.基本空手攻击力 * 0.1;
}
_root.效果("天蓝增幅",_parent._x,_parent._y,100);

